"    <div id=\"topicTitle\">",
"     Patient information: Pelvic fracture (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pelvic-fracture-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H867668125\">",
"      <span class=\"h1\">",
"       What is a pelvic fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A &ldquo;fracture&rdquo; is another word for a broken bone. A pelvic fracture is when a person breaks his or her pelvis (",
"      <a class=\"graphic graphic_figure graphicRef83511 \" href=\"UTD.htm?40/13/41173\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      There are different types of pelvic fractures, depending on the part of the pelvis that breaks and how it breaks.",
"     </p>",
"     <p>",
"      Some pelvic fractures happen after falls or sports injuries. But most pelvic fractures happen from car accidents or other severe injuries. In these cases, the injury causing the pelvic fracture can also damage organs, nerves, and blood vessels near the pelvis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668140\">",
"      <span class=\"h1\">",
"       What are the symptoms of a pelvic fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms of a pelvic fracture can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain",
"       </li>",
"       <li>",
"        Swelling",
"       </li>",
"       <li>",
"        Bruising",
"       </li>",
"       <li>",
"        Trouble walking or pain when walking",
"       </li>",
"       <li>",
"        Weakness or loss of feeling in the legs",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668155\">",
"      <span class=\"h1\">",
"       Is there a test for a pelvic fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Tests to check for a pelvic fracture can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        An X-ray of the pelvis",
"       </li>",
"       <li>",
"        An imaging test of the pelvis, such as a CT scan &ndash; Imaging tests create pictures of the inside of the body.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668170\">",
"      <span class=\"h1\">",
"       How is a pelvic fracture treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on the type of pelvic fracture you have and how severe it is.",
"     </p>",
"     <p>",
"      A mild pelvic fracture is usually treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Rest",
"       </li>",
"       <li>",
"        Ice &ndash; You can put a cold gel pack, bag of ice, or bag of frozen vegetables on the area every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and the skin. Use the ice (or other cold object) for at least 6 hours after the injury. Some people find it helpful to ice up to 2 days after an injury.",
"       </li>",
"       <li>",
"        Crutches or a walker to help with walking",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Right after an injury, doctors usually treat a severe pelvic fracture by putting a splint or other binding material around the pelvis to hold it in place.",
"     </p>",
"     <p>",
"      Then a severe pelvic fracture is treated with surgery to put the pelvis back in the correct position. During surgery, the doctor might:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Use screws, pins, rods, or plates to fix the bone inside the body",
"       </li>",
"       <li>",
"        Put pins or screws through the skin and into the bone, and then attach the pins or screws to a bar that is outside the skin",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Treatment for a pelvic fracture also includes medicine to treat the pain. Doctors can prescribe a strong pain medicine if people have a lot of pain or a severe fracture. For mild fractures, doctors usually recommend that people take an over-the-counter pain medicine. Over-the-counter medicines include",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      (sample brand name: Tylenol&reg;),",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      (sample brand names: Advil&reg;, Motrin&reg;), and",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"       naproxen",
"      </a>",
"      (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"     </p>",
"     <p>",
"      After surgery and after your bones are mostly healed, you will work with a physical therapist (exercise expert). He or she will teach you exercises to make the muscles around your pelvis stronger. He or she will also work with you on bending, walking, and climbing stairs so you can move normally again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668185\">",
"      <span class=\"h1\">",
"       How long does a pelvic fracture take to heal?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A pelvic fracture usually takes months to heal, depending on the fracture.",
"     </p>",
"     <p>",
"      Healing time also depends on the person. Healthy children usually heal much more quickly than older adults or adults with other medical problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668200\">",
"      <span class=\"h1\">",
"       Can I do anything to improve the healing process?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. It&rsquo;s important to follow all of your doctor&rsquo;s instructions while your fracture is healing. Plus, doctors usually recommend that people with a fracture:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Eat a healthy diet that includes getting enough calcium, vitamin D, and protein (",
"        <a class=\"graphic graphic_figure graphicRef79375 \" href=\"UTD.htm?18/13/18647\">",
"         figure 2",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Stop smoking. A fracture can take longer to heal if you smoke.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668238\">",
"      <span class=\"h1\">",
"       When should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, your doctor or nurse will tell you when to call him or her. In general, you should call him or her if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You get a fever.",
"       </li>",
"       <li>",
"        You have severe pain, or your pain or swelling gets worse.",
"       </li>",
"       <li>",
"        Your leg gets swollen or you see red streaks on your leg.",
"       </li>",
"       <li>",
"        You have chest pain, trouble breathing, or dizziness.",
"       </li>",
"       <li>",
"        Fluid or pus drains out of the cut from your surgery.",
"       </li>",
"       <li>",
"        You get an open sore on your skin.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H867668253\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
