var title_f5_21_5469="Hip examination";
var content_f5_21_5469=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F69960&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F69960&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Detailed examination of the hip",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Examination",
"signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Confirmation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tenderness mid or superior trochanter**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        #1",
"Trochanteric bursitis",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Local",
"anesthetic block",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Associations:",
"stiff back, short",
"leg, ankle or knee pathology, stroke",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal",
"range of motion of the hip",
"with minimal end point stiffness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stiffness",
"and mild pain with internal",
"or external rotation or both**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Osteoarthritis of",
"the hip",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Standing AP pelvis x-ray",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tenderness",
"over the anterior hip",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal",
"Patrick's maneuver",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypesthesia",
"or paresthesias over the",
"anterolateral thigh**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Meralgia paresthetica",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No",
"evidence of lumbar radiculopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No",
"evidence",
"of hip disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acute",
"loss and severe pain with internal or external",
"rotation or both**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Avascular necrosis of the hip;",
"acute arthritis;",
"septic arthritis",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        MRI; AP pelvis x-ray; or",
"aspiration of the hip by fluoroscopy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limping",
"with an antalgic gait",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tenderness",
"over the",
"anterior hip",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal",
"Patrick's maneuver",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acute",
"loss and severe pain",
"with internal or external rotation or both following an injury**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        Occult",
"hip fracture",
"       </td>",
"       <td colspan=\"1\" rowspan=\"4\">",
"        MRI; AP pelvis x-ray",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Severe",
"antalgic gait or refusal to bear weight",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tenderness",
"over the anterior",
"hip",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal",
"Patrick's maneuver",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diminished",
"dorsalis pedis and posterior",
"tibial pulses**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Vascular insufficiency",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Doppler",
"study",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Delayed",
"capillary fill times",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Straight",
"leg maneuver",
"reproduces radicular pain**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Lumbar",
"radiculopathy",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        CT or MRI demonstrating nerve",
"compression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Painful",
"and limited flexion and lateral",
"bending",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal",
"lower extremity neurologic examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain",
"aggravated",
"by torque applied to the femur**",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Primary or",
"secondary involvement of the femur",
"       </td>",
"       <td colspan=\"1\" rowspan=\"3\">",
"        Full x-ray of",
"the femur; bone",
"scan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Localized",
"bony tenderness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Positive",
"Anvil sign",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ** is used to identify the hallmark sign; that is, the sign that has the greatest specificity for the diagnosis listed.",
"     <br>",
"      #1 refers to the most common condition affecting the hip.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
